import React from 'react';
import './Contact.css';

function Contact() {
  return (
    <div className="contact-page">
      <h2>Contact Us</h2>
      <p>Email: achusfoods@example.com</p>
      <p>Phone: +91 98765 43210</p>
    </div>
  );
}

export default Contact;
